function Checkbox() {

    const handleClick = (e)=> {
        console.log(e.target.id)
    }

  return (
    <div className="checkboxes flex flex-col space-y-2 w-full text-white text-xl">
          <label className='flex space-x-3 ' onClick={handleClick} id="upper-check"><input type="checkbox"/><span>Include Uppercase Letters</span></label>
          <label className='flex space-x-3 ' onClick={handleClick} id="lower-check"><input type="checkbox"/><span>Include Lowercase Letters</span></label>
          <label className='flex space-x-3 ' onClick={handleClick} id="num-check"><input type="checkbox"/><span>Include Numbers</span></label>
          <label className='flex space-x-3 ' onClick={handleClick} id="sym-check"><input type="checkbox"/><span>Include Symbols</span></label>
    </div>
  )
}

export default Checkbox
